import { Outlet, Link } from "react-router-dom";

const BeginLayout = () => {
  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to="/Login_Driver"></Link>
          </li>
          <li>
            <Link to="/Login_Store">Blogs</Link>
          </li>
          <li>
            <Link to="/Login_User">Contact</Link>
          </li>
        </ul>
      </nav>

      <Outlet />
    </>
  )
};

export default BeginLayout;
